import { useState } from 'react'
import Task from './Task';
import moment from "moment";

function App() {
  const {tasksRender, setRender} = useState([])

  return (
    <main>
    <h1>ToDo</h1>
    <div className="tasksBox">
      {
        tasksRender.map((task) => {
            return (
              <Task 
                task={task}
              />
            )
          }
        )
      }
      </div>    
  </main>
  );
}

export default App;
